import React from "react";
import { Button } from "react-bootstrap";
import "../utils/consts";
import { BASKET_ROUTE, LOGIN_ROUTE, PROFILE_ROUTE } from "../utils/consts";
import {useHistory} from "react-router-dom";

const Header =() => {
    const historylast = useHistory()
    const auth = () =>{
        historylast.push(LOGIN_ROUTE)
        console.log('сраотало')
    }
    const profile = () =>{
        historylast.push(PROFILE_ROUTE)
        console.log('сраотало')
    }
    const basket = () =>{
        historylast.push(BASKET_ROUTE)
        console.log('сраотало')
    }


    return(
        <div style={{background: '#424242', height: '20px', fontSize: '12px'}}>
            <div style={{display:'flex', paddingLeft: '8%', paddingRight: '8%', justifyContent:'right'}}>            
                <button   style={{paddingRight: '26px', color: "white",border: 0, background: 'transparent', outline:'none'}} onClick={auth}>Войти/Авторизироваться </button>
                <button   style={{paddingRight: '26px', color: "white",border: 0, background: 'transparent', outline:'none'}}>My Account </button>
                <button   style={{paddingRight: '26px', color: "white",border: 0, background: 'transparent', outline:'none'}}>Order Status </button>
                <button   style={{paddingRight: '26px', color: "white",border: 0, background: 'transparent', outline:'none'}}>Help </button>
            </div>
        </div>
    );
};

export default Header;
